                return False  # Early return if there's a closing bracket without an opening
            else:
                stack.pop()
    # If stack is empty, all brackets were matched, but we still need to check for nesting.
    # A string with all matched brackets is only nested if its length is greater than 2 
    # (meaning there was at least one set of brackets inside another).
    return len(string) > 2 and not stack

