        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)

    # Check if intervals do not intersect
    if start > end:
        return "NO"

    # Calculate the length of the intersection; not including the endpoints as part of the length
