    # If intervals only touch at a point or overlap completely, treat as no prime length
    if length <= 0:
        return "NO"

    return "YES" if is_prime(length) else "NO"

from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_val = min(min(row) for row in grid)  # Find the minimum value in the grid
    start_positions = [(i, j) for i in range(N) for j in range(N) if grid[i][j] == min_val]

    def neighbors(x, y):
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                yield nx, ny

    best_path = None

    for sx, sy in start_positions:
        heap = [([grid[sx][sy]], sx, sy)]
        while heap:
            path, x, y = heappop(heap)
            if len(path) == k:
                if best_path is None or path < best_path:
                    best_path = path
                break  # Stop searching once we reach the desired path length
            for nx, ny in neighbors(x, y):
                new_path = path + [grid[nx][ny]]
                if best_path is None or new_path < best_path:
                    heappush(heap, (new_path, nx, ny))

    return best_path

def tri(n):
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    if n == 2:
        return [1, 3, 2]

    trib = [1, 3, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(1 + i // 2)
        else:
            next_val = trib[i - 1] + trib[i - 2] + trib[i-3] if i - 3 >= 0 else trib[i - 1] + trib[i - 2]
            trib.append(next_val)
    return trib

