    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                # Unmatched closing bracket, not a valid structure.
                return False
            else:
                stack.pop()

    # After processing all characters, check if there was a nested structure.
    # A nested structure requires at least one '[' to be followed by another '[' before a ']'.
    # This means the maximum length of the stack should have been at least 2 at some point.
    return len(stack) == 0 and string.find('[[') != -1 and string.find(']]') != -1

