        if vowel in vowels_lower:
            return vowels_lower[(vowels_lower.index(vowel) + shift) % len(vowels_lower)]
        elif vowel in vowels_upper:
            return vowels_upper[(vowels_upper.index(vowel) + shift) % len(vowels_upper)]
        return vowel

    def swap_case(character):
        if character.isalpha():
            return character.lower() if character.isupper() else character.upper()
        return character

    encoded_message = ''
    for char in message:
