def minPath(grid, k):
    N = len(grid)
    # Convert grid values to (value, x, y) and sort to get the starting points in order
    sorted_cells = sorted([(grid[x][y], x, y) for x in range(N) for y in range(N)])
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    best = {}

    for value, x, y in sorted_cells:
        heap = [(value, x, y, [value])]
        while heap:
            _, cx, cy, path = heappop(heap)
            if len(path) == k:
                return path
            if (cx, cy, len(path)) in best and best[(cx, cy, len(path))] <= path:
                continue
            best[(cx, cy, len(path))] = path
            for dx, dy in moves:
                nx, ny = cx + dx, cy + dy
                if 0 <= nx < N and 0 <= ny < N:
                    newPath = path + [grid[nx][ny]]
                    heappush(heap, (newPath[-1], nx, ny, newPath))

