    nested = False  # Keep track of whether we have seen a nested bracket.
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack:
                stack.pop()
                # Only mark as nested if there's something in the stack before popping.
                if stack:
                    nested = True
            else:
                # If we try to pop from an empty stack, it's not properly nested.
                return False
    # The string is only considered properly nested if there's nothing left in the stack
    # and we found at least one pair of nested brackets.
    return nested and not stack

def tri(n):
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]

    # Initialize the sequence with the first three known values
    trib = [1, 3, 2]

    # Adjust the calculation for the sequence beyond the third element
    for i in range(3, n + 1):
        if i % 2 == 0:
            trib.append(1 + i / 2)  # Use division to get the correct float value
        else:
            # For odd indices, fix the formula to correctly calculate the next element
            next_val = trib[i - 1] + trib[i - 2] + trib[i - 3]
            trib.append(next_val)

    return trib

