def is_multiply_prime(a):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    if a < 2:
        return False

    prime_factors = 0
    for i in range(2, a + 1):
        if a % i == 0 and is_prime(i):
            # Count the number of times this prime factor divides 'a'
            while a % i == 0:
                a //= i
                prime_factors += 1
            if prime_factors > 3:
                # If there are more than 3 prime factors, return False early
                return False
    return prime_factors == 3

