def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    if n == 1:
        return 1  # Only one digit, so it's either 1
    else:
        # Numbers that start with 1: 10**(n-1)
        # Numbers that end with 1: 10**(n-1)
        # Subtract the overlap (which is 0, since there's no number that both starts and ends with 1 without being the same number)
        # So, we simply add the counts for starting with 1 and ending with 1.
        return 2 * (10 ** (n - 1))

