    return sum(is_odd_and_greater_than_10(num) for num in nums)

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]

    if planet1 not in planets or planet2 not in planets:
        return ()

    start = min(planets.index(planet1), planets.index(planet2))
    end = max(planets.index(planet1), planets.index(planet2))

    return tuple(planets[start+1:end])

def x_or_y(n, x, y):
    if n < 2:
        return y
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return y
    return x

def even_odd_count(num):
    even_count = 0
    odd_count = 0
    for digit in str(abs(num)):
        if int(digit) % 2 == 0:
            even_count += 1
        else:
            odd_count += 1
    return (even_count, odd_count)

def right_angle_triangle(a, b, c):
    sides = sorted([a, b, c])
    return sides[0]**2 + sides[1]**2 == sides[2]**2

def do_algebra(operator, operand):
    expression = str(operand[0])
    for op, num in zip(operator, operand[1:]):
        expression += f' {op} {num}'
    return eval(expression)

def solve(s):
    if all(not c.isalpha() for c in s):
        return s[::-1]
    else:
        return ''.join(c.lower() if c.isupper() else c.upper() if c.islower() else c for c in s)

import hashlib

def string_to_md5(text):
    """
    Given a string 'text', return its md5 hash equivalent string.
    If 'text' is an empty string, return None.

    >>> string_to_md5('Hello world') == '3e25960a79dbc69b674cd4ec67a72c62'
    """
    if text == "":
        return None
    else:
        return hashlib.md5(text.encode()).hexdigest()

def get_max_triples(n):
    """
    :type n: int
    :rtype: int
    """
    # Generate the array
    a = [i * i - i + 1 for i in range(1, n + 1)]
    count = 0

    # Iterate through all possible triples
    for i in range(n):
        for j in range(i + 1, n):
            for k in range(j + 1, n):
                if (a[i] + a[j] + a[k]) % 3 == 0:
                    count += 1
    return count

def maximum(arr, k):
    """
    Given an array arr of integers and a positive integer k, return a sorted list 
    of length k with the maximum k numbers in arr.
    """
    return sorted(sorted(arr, reverse=True)[:k])

def split_words(txt):
    if ' ' in txt:
        return txt.split()
    elif ',' in txt:
        return txt.split(',')
    else:
        return sum(1 for char in txt if char.islower() and (ord(char) - ord('a')) % 2 == 1)

def match_parens(lst):
    str1, str2 = lst
    # Check if concatenating in any order results in a balanced string
    def is_balanced(s):
        balance = 0
        for char in s:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            if balance < 0:
                return False
        return balance == 0

    # Check both possible concatenations
    return 'Yes' if is_balanced(str1 + str2) or is_balanced(str2 + str1) else 'No'

def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if start > end:
        return "NO"
    length = end - start
    return "YES" if is_prime(length) else "NO"

def get_closest_vowel(word):
    vowels = "aeiouAEIOU"
    closest_vowel = ""
    for i in range(len(word) - 2, 0, -1):
        if word[i] in vowels and word[i-1] not in vowels and word[i+1] not in vowels:
            return word[i]
    return closest_vowel

def cycpattern_check(a, b):
    if len(b) > len(a):
        return False
    extended_a = a + a
    for i in range(len(b)):
        rotated_b = b[i:] + b[:i]
        if rotated_b in extended_a:
            return True
    return False

def order_by_points(nums):
    def digit_sum(n):
        return sum(int(digit) for digit in str(abs(n)))

    return sorted(nums, key=lambda x: (digit_sum(x), nums.index(x)))

def is_nested(string):
    stack = []
    nested = False  # Flag to check if there's any nested structure.

    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                return False  # Unmatched closing bracket.
            stack.pop()
            if stack:  # If there's still an opening bracket, it means the current one was nested.
                nested = True

    return nested and not stack  # True if nested and all brackets are matched.
